import { Button, TextField, Typography } from '@mui/material';
import './SignUp.css';
import logo from '../../assets/Image/login.png';
import { useNavigate } from "react-router-dom";
const SignUp=()=>{
    const navigate = useNavigate();

    // State for managing form inputs
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");
    const [contactNumber, setContactNumber] = useState("");
  
    // State for managing form validation errors
    const [errors, setErrors] = useState({});
    return (
        <div className="signup">
            <img className='imglogo' src={logo} alt=''></img>                   
                <Typography variant="h6"
                    component="div" sx={{ flexGrow: 1,textShadow:1 }}>                        
                    Sign up</Typography>
                    <div className="signup-body">
		<div className="signup_form-container">
			<div >
				<div className="round-icon"> 
					<LockIcon style={{ marginRight: '5px', fontSize: 30 }}/> 
				</div>
				<h2>Sign Up</h2>
			</div>
			<form onSubmit={handleSignup}>
				<div>
				<TextField
					label="First Name"
					variant="outlined"
					margin="normal"
					fullWidth
					value={firstName}
					onChange={(e) => setFirstName(e.target.value)}
				/>
				<TextField
					label="Last Name"
					variant="outlined"
					margin="normal"
					fullWidth
					value={lastName}
					onChange={(e) => setLastName(e.target.value)}
				/>
				<TextField
					label="Email"
					variant="outlined"
					margin="normal"
					fullWidth
					value={email}
					onChange={(e) => setEmail(e.target.value)}
				/>
				<TextField
					label="Password"
					type="password"
					variant="outlined"
					margin="normal"
					fullWidth
					value={password}
					onChange={(e) => setPassword(e.target.value)}
				/>
				<TextField
					label="Confirm Password"
					type="password"
					variant="outlined"
					margin="normal"
					fullWidth
					value={confirmPassword}
					onChange={(e) => setConfirmPassword(e.target.value)}
				/>
				<TextField
					label="Contact Number"
					variant="outlined"
					margin="normal"
					fullWidth
					value={contactNumber}
					onChange={(e) => setContactNumber(e.target.value)}
				/>
				<Button
					className="login__button"
					variant="contained"
					color="primary"
					onClick={handleSignup}
					fullWidth
				>
					SIGN UP
				</Button>
				</div>
			</form>
			<p>
				Already have an account? <a href="/login">Sign in</a>
			</p>
			<p style={{ textAlign:'center',padding:'50px' }}>
				Copyright â“’ <a href="/signup">UpGrade</a> 2021
			</p>
		</div>
	</div>
        </div>
    )
}

export default SignUp;
